INSERT INTO `itsystem` (`systemid`, `datereported`, `dateaccomplish`, `subject`, `module`, `description`, `systemtypes`, `projectid`, `errortypes`, `prioritylevel`, `reportedby`, `remarks`, `ticketid`, `findings`, `actiontaken`, `file`, `status`, `createdat`) VALUES
(19, '2025-19-09', ' ', 'Documentation of Transaction Posting and Process Flow ', 'Transaction Posting ', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Dear All,</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><p><i>Feliz Día! </i></p><p>Here is the the documentation of solutions and actions suggested based on our previous meeting yesterday: </p></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><h3><font face=\"arial, sans-serif\" size=\"2\">1) Posting of Prepaid Charges (Extra Breakfast, Island Crew Package)</font></h3><ul><li style=\"margin-left: 15px;\"><p><font face=\"arial, sans-serif\"><font color=\"#ff0000\"><b>Solution:</b></font> <i>Based on our conversation yesterday September 18, 2025 <b>Optima Team</b> will set an online meeting with our <b>IT</b> for the POS and to tackle the posting matters related to Finance. As of now we will still follow the manual posting if there are charges that were paid prior to the guest booking. Follow up IT for the set meeting date. </i></font></p></li></ul><div><h3><font size=\"2\">2) No-Show Reservations</font></h3><ul><li style=\"margin-left: 15px;\"><p><font face=\"arial, sans-serif\"><font color=\"#ff0000\"><b>Solution:</b></font> <i>Please assist us to configure in the system based on your given suggestion to ensure that all the <b>NO-SHOW</b> per night rates will automatically be generated in the Optima and that all charges of the booking will be posted directly in the system. </i></font></p></li></ul><h3><font size=\"2\">3) Cancelled Bookings with Penalty</font></h3><ul><li style=\"margin-left: 15px;\"><p><font face=\"arial, sans-serif\"><font color=\"#ff0000\"><b>Solution:</b></font> <i>We will follow the Optima team advice to input the booking manually if the booking was not cancelled automatically in the Optima system and to tick the <b>\"Cancel\"</b> button in the <b>\"&\" </b>option. Ensure that all the nightly rates are correct and manually post the cancelled amount in the charges section to identify the revenue. </i></font></p></li></ul><p>4) <strong>Shortened Stays</strong></p><ul><li style=\"margin-left: 15px;\"><p><font face=\"arial, sans-serif\"><font color=\"#ff0000\"><b>Solution:</b></font> <i>As mentioned you can configure in the system that the </i></font><i>subsequent nights can be run all in one day by using the \"<b>Autopost</b>\" option instead of doing it one by one and every after running the Night Process. Please assist us to change the set up of the autopost for us to be able to use this option. </i></p></li></ul><div><h3><font size=\"2\">2) VIP Reports</font></h3><p>For all the guests that were tagged as VIP\'s (all tiers of VIP) in the system we would like to clarify the correct report to extract with the following details indicated:</p><p></p><ul><li style=\"margin-left: 15px;\">Guest Name</li><li style=\"margin-left: 15px;\">Contact Details and Email Address</li><li style=\"margin-left: 15px;\">Dates of Stay</li><li style=\"margin-left: 15px;\">Number of Stay in the hotel</li><li style=\"margin-left: 15px;\">Revenue of their total stay</li></ul><p></p><p><font color=\"#ff0000\">Concern:</font> <i>We extract the Reports <b>#203</b> and <b>#213</b> however details showing up are something that we do not need. As for the Report <b>#240</b> Returning Guests only shows up and some are not considered as VIP\'s however since booking dates are separated they were able to configure it as Returning Guests due to 2 separate booking dates made.</i></p><p><font color=\"#ff0000\">Action Required:</font> The Optima Team needs to provide us with the accurate report needed based on the given details that we provided. </p><p>Please advise on the best course of action to address these concerns, and let me know if further clarification is needed on any points.</p></div></div></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Thank you.</div>', 'Optima PMS', '102501', 'Request for Modification', 'High', '0', '<pre class=\"\"><p>Hi Optima Helpdesk Team,</p><p>We would like to inquire about the possibility of generating a comprehensive <b>VIP Guest Profile Report</b> from our Optima PMS system. We are looking for a report that can provide a detailed view of a guest\'s history, including personal information, reservation details, and a summary of their activity.</p><p>We have attached a sample of the report we are hoping to extract.</p><p></p><h3><b>1. Guest Personal Information</b></h3><p></p><ul><li><p><b>Guest Name:</b></p></li><li><p><b>Company:</b></p></li><li><p><b>Title/VIP Status:</b></p></li><li><p><b>Country:</b> </p></li><li><p><b>Nationality:</b></p></li><li><p><b>Date of Birth:</b> </p></li><li><p><b>Email Address:</b> </p></li><li><p><b>Phone No.:</b> </p></li><li><p><b>Passport No.:</b> </p></li><li><p><b>Address:</b> </p></li></ul><p></p><h3><b>2. Reservation Summary</b></h3><p></p><ul><li><p><b>Total Records:</b></p></li><li><p><b>Total Rooms Booked:</b></p></li><li><p><b>Total Nights Stayed:</b> </p></li><li><p><b>Total Adults:</b> </p></li><li><p><b>Total Children:</b> </p></li><li><p><b>Total Room Revenue:</b> </p></li><li><p><b>Grand Total Revenue:</b> </p></li></ul><p></p><h3><b>3. Reservation & Stay History</b></h3><p></p><div class=\"horizontal-scroll-wrapper\"><div class=\"table-block-component\"><response-element class=\"\" ng-version=\"0.0.0-PLACEHOLDER\"><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><!----><table-block _nghost-ng-c1298775275=\"\" class=\"ng-star-inserted\"><div _ngcontent-ng-c1298775275=\"\" class=\"table-block has-export-button\"><div _ngcontent-ng-c1298775275=\"\" not-end-of-paragraph=\"\" class=\"table-content not-end-of-paragraph\" jslog=\"275421;track:impression,attention\"><table><thead><tr><td><b>RM No.</b></td><td><b>RM Type</b></td><td><b>Rate</b></td><td><b>Rate Code</b></td><td><b>C/In Date</b></td><td><b>C/Out Date</b></td><td><b>Nights</b></td><td><b>Source</b></td><td><b>Company</b></td><td><b>Rate Amount</b></td><td><b>Total Revenue</b></td><td><b> Status</b></td></tr></thead><tbody><tr><td>[Room Number]</td><td>[Room Type]</td><td>[Rate]</td><td>[Rate Code]</td><td>[Check-in Date]</td><td>[Check-out Date]</td><td>[Nights]</td><td>[Source]</td><td>[Company]      </td><td>[Rate Amount]</td><td>[Total Revenue]</td><td> [Status]</td></tr><tr><td>123</td><td>Dlx</td><td>3,200.00</td><td> BB</td><td>4/18/2025</td><td>4/20/2025</td><td>2</td><td>Expedia   </td><td>A Corporation</td><td> 6,400.00         </td><td>7,168.00</td><td> COUT</td></tr><tr><td>456</td><td>EXEC</td><td>5,200.00</td><td> BB</td><td>4/25/2025</td><td>4/28/2025</td><td>3</td><td>Walk-in</td><td>B Company</td><td> 15,600.00</td><td>17,472.00 </td><td> COUT</td></tr><tr><td><b>...</b></td><td><b>...</b></td><td><b>...</b></td><td><b>...</b></td><td><b>...</b></td><td><b>...</b></td><td><b>...</b></td><td><b>...</b></td><t', 'SCSB2541691', '', '', '', 'In Progress', '2025-10-08 16:55:15'),
(20, '2025-19-09', ' ', 'Transaction Code Computation', 'Transaction Code', '<p><google-sheets-html-origin style=\"color: rgb(0, 0, 0); font-size: medium; font-weight: 400;\"></google-sheets-html-origin></p><div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">FRONT OFFICE</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">1. Arrival per day with net rate (exclusive of Vat and SC) - #211</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">2. Daily Occupancy/Room Income - #460</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">2a. Please include the computation for breakfast for 2 pax (net — exclusive of VAT and service charge).</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">2b. Please provide a separate column for the additional person charges (net) that are included in the nightly rate.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">Bfast and extra person rate should have separte columns also.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">2c. Total net revenue column after deducting Bfast buffet & additional person charges.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">2c. Company Name - should be specific agent/company name where the reservation/booking was booked. I see some were</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">encoded as ITA, OTA, TA bulk Buy. This is for the purpose of aligning with the market segment/GL account classification</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">in our SAP system.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">2d. Below are the Market Segment/GL Account that is available in our SAP system. Can we use this instead? For Direct</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">Bookings, we can identify it as BAR, Promo Rate, EFF or Affiliates.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">        Best Available Rate</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">        Promo Rate</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">        Online Travel Agency</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">        Travel Agency (Local)</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">        Employees, Friends and Family Rate</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">        Affiliates</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">3. Transportation Summary - no showed computation of Vat, Non-vat,</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">3a. Add specific Vat/NonVat amount each category</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">3b. Add commission amount each category</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">3c. Specify if transpo is Arrival or Departure.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">4. Feliz Merch Summary Report - Only Gross amount was showed, no showed computation of Vat and Non-vat</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">5. MiniBar Summary Report - Only Gross amount was showed, no showed computation of Vat, Non-vat, and SC</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">6. Extra Charges Breakdown Report #411- Only Gross amount was showed, no showed computation of Vat, and Non-vat</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">6a. Extra pax posted in arrival date only x number of nights. Can we post it in different date? Since DRR should be</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">declared per day.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">6b. Transportation please be specific with the transportation charges, if local adult, foreign adult, local kid and age</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">bracket, foreign kid and age bracket, senior, and exact # of pax availed. Also, can we specify in one way transportation</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">if its arrival or departure?</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">7. Invoices generated should be inputted by FO not from Optima it should corresponds with the invoice/cr number released</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\">to the guests.</span></font></div><div><font face=\"Arial\"><span style=\"font-size: 13.3333px;\"', 'Optima PMS', '102501', 'Request for Assistance', 'Medium', '1010152', '<p><span style=\"font-weight: normal;\">Send to Optima Team/Helpdesk Team</span></p><p><span style=\"font-weight: 400;\">Subject :&nbsp;System Concern : Optima PMS- Transaction Code - Request for Assistance</span></p><p><span style=\"font-weight: 400;\">With TicketID Date September 20, 2025</span></p>', 'SCSB2541692', '', '', '', 'In Progress', '2025-10-08 16:55:15'),
(25, '2025-19-09', ' ', 'Request for Billing Breakdown', 'Billing Breakdown', '<p style=\"font-weight: 400;\"><span style=\"font-weight: bolder;\">Subject:</span>&nbsp;Request for Billing Breakdown</p><p style=\"font-weight: 400;\">Hi STaah Helpdesk,</p><p style=\"font-weight: 400;\">We would like to request a detailed breakdown of the \"Room Taxes\" for the billing shown in the attached screenshot. The total amount is PHP 36,925.00.</p><p style=\"font-weight: 400;\">We need a breakdown that follows this format:</p><ul style=\"font-weight: 400;\"><li><p><span style=\"font-weight: bolder;\">Room Total:</span>&nbsp;31,559</p></li><li><p><span style=\"font-weight: bolder;\">Vat:</span>&nbsp;3,787.18</p></li><li><p><span style=\"font-weight: bolder;\">SC:</span>&nbsp;1,577.99</p></li><li><p><span style=\"font-weight: bolder;\">Balance Due:</span>&nbsp;36,925</p><p><br></p></li></ul><p class=\"\" style=\"font-weight: 400;\">STAAH Existing Billing Format</p><p class=\"\" style=\"font-weight: 400;\">Room Total : 31,559.00</p><p class=\"\" style=\"font-weight: 400;\">Room Taxes : 5,366.00</p><p class=\"\" style=\"font-weight: 400;\">Amount Paid : 0.00</p><p class=\"\" style=\"font-weight: 400;\">Balance Due : 36,925.00</p><p class=\"\" style=\"font-weight: 400;\">Total Amount : PHP 36,925.00&nbsp;</p>', 'STAAH', '', 'Request for Assistance', 'Medium', '1010152', '<p>Email to STAAH Helpdesk</p>', '', '<p>TEst12</p>', '<p>TEst12</p>', '0-02-06-a86d98ac3455ebdf2c9fc428e4f1c430d21865b412df8c0f1142c677a02cb31f_cd0d4aae25f273b2.jpg', 'In Progress', '2025-09-20 03:10:45'),
