(30, '2025-20-09', '2025-20-09', 'Error Message -Datastore Error', 'Error Message -Datastore Error', '<p><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Hi Optima Team,</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Additional concern from the Front Office department:</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Our team has been encountering a persistent error message on the system since yesterday. The error message is:</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">\"Datastore Error (id_chv_dynamic_buttons_</span><wbr style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">arguments_list) Error in row 0: -308 Select Error: SQLSTATE = 08S01 [SAP][ODBC Driver][SQL Anywhere]Connection was terminated\"</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">When this error appears, sometimes the system automatically closes after clicking \"OK\" multiple times. On other occasions, the error message does not close automatically.</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Please assist us in resolving this issue.</span></p>', 'Optima PMS', '102501', 'System Glitch', 'High', '1010126', '<div dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-size: 12pt; font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\"><br></div>', 'SCSB2541374 ', '<div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Hi Armani,</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\"><br></div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Just special note for us regarding if log in is dormant for 2hrs it will disconnect - which means anything that user facilitate will fail :)&nbsp;</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\"><br></div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Maybe this is worth mentioning to team.</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\"><br></div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Thanks,</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Issa</div>', '<div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Hi Armani,</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\"><br></div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Just special note for us regarding if log in is dormant for 2hrs it will disconnect - which means anything that user facilitate will fail :)&nbsp;</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\"><br></div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Maybe this is worth mentioning to team.</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\"><br></div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Thanks,</div><div dir=\"ltr\" style=\"font-size: 12pt; color: rgb(34, 34, 34); font-weight: 400; font-family: Aptos, Aptos_MSFontService, -apple-system, Roboto, Arial, Helvetica, sans-serif;\">Issa</div>', '', 'Done', '2025-10-08 16:55:19');
INSERT INTO `itsystem` (`systemid`, `datereported`, `dateaccomplish`, `subject`, `module`, `description`, `systemtypes`, `projectid`, `errortypes`, `prioritylevel`, `reportedby`, `remarks`, `ticketid`, `findings`, `actiontaken`, `file`, `status`, `createdat`) VALUES
(31, '2025-20-09', '2025-01-10', 'Data Mismatch: STAAH to PMS Agent Field', 'Booking Information', '<p><span style=\"font-weight: normal;\">Hi STaah Helpdesk,</span></p><p><span style=\"font-weight: normal;\">We are writing to report a data synchronization issue between the STAAH Channel Manager and our Property Management System (PMS).</span></p><p><span style=\"font-weight: normal;\">The Agent field in our PMS is reflecting \"STAAH 00\" instead of the correct booking source, such as Agoda. This is causing inaccuracies in our reporting.</span></p><p><span style=\"font-weight: normal;\">Please see the attached image for an example of a booking where this has occurred.</span></p><p><span style=\"font-weight: normal;\">We would like assistance in resolving this concern to ensure the correct booking source is passed to the Agent field for all future reservations.</span></p>', 'Optima PMS', '102501', 'Setup/Configuration Issue', 'Medium', '1010129', '', 'STAAH Ticket ID : 1200381 | Optima : SCSB2541735', '', '', 'PMS STAAH Market Segment.jpg', 'Done', '2025-10-08 16:55:19'),
(32, '2025-23-09', '2025-01-10', 'Following up on SYSTEM Manual/Training Video', 'System Manual', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Hi Optima Helpdesk,</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">I\'m writing to follow up on the <b>SYSTEM manual</b> and any available <b>recorded video training</b> we discussed. In our meeting last <b>Thursday, September 18th</b>, it was mentioned that you would be sending these resources.</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Could you please let me know when I can expect to receive them?</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Having this material would be a great help.</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Thanks,</p>', 'Optima PMS', '102501', 'Setup/Configuration Issue', 'Medium', '1010163', '', 'SCSB2541959 ', '', '', 'Priority Hospitality - Optima POS User\'s Manual (EN).pdf', 'Done', '2025-10-08 16:55:19'),
(33, '2025-23-09', '2025-29-09', 'Request for Support: Front Office Accounts - No Keycard Access', 'No Keycard Access', '<div><p><span style=\"font-weight: normal;\">Hi Optima Helpdesk,</span></p><p><span style=\"font-weight: normal;\">I need your assistance with a user access issue.</span></p><p><span style=\"font-weight: normal;\">I\'ve created new accounts for three employees—</span><b>katalasan, fflorentin, and dromano</b><span style=\"font-weight: normal;\">—but they are unable to create keycards. The keycard icon is missing from their toolbar.</span></p><p><span style=\"font-weight: normal;\">I\'ve attached screenshots showing the difference between their toolbar and one with the correct access.​</span></p><span style=\"font-weight: bolder;\">​</span><span style=\"font-weight: normal;\">Could you please grant these accounts the necessary permissions?</span></div><div><p><span style=\"font-weight: normal;\">Also, if you have a step-by-step guide on how to properly set up new accounts with full Front Office access, that would be very helpful for future reference.</span></p><p><span style=\"font-weight: normal;\">Thank you,</span></p></div>', 'Optima PMS', '102501', 'Setup/Configuration Issue', 'High', '1010163', '<p>Follow Up on Instruction how to setup Create key card access</p>', 'SCSB2541960 | SCSB2541990 ', '<p><img src=\"data:image/jpeg;base64,', '', '', 'Done', '2025-10-08 16:55:19'),
(34, '2025-23-09', ' ', 'Clarification on Payment Gateway Process for Direct Website Bookings - Feliz Hotel Boracay', 'STAAH', '<div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><font face=\"sans-serif\" color=\"#000000\">Dear Support Team,</font></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><font face=\"sans-serif\" color=\"#000000\"><br></font></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><font face=\"sans-serif\" color=\"#000000\">Feliz Dia!</font></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><font face=\"sans-serif\" color=\"#000000\"><br></font></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">We would like to request clarification regarding the payment flow for our direct website bookings, as we encountered the following issue:</div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br>Booking Source: Website (captured in STAAH under “Website Bookings”) but booking is under non-refundable.</div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><img src=\"https://mail.google.com/mail/u/0?ui=2&ik=9b61b8aad0&attid=0.1.4&permmsgid=msg-f:1844040270644157340&th=199758db23429b9c&view=fimg&fur=ip&permmsgid=msg-f:1844040270644157340&sz=s0-l75-ft&attbid=ANGjdJ-I0277P0slSHUjKcEgrTfbg38qNiDHX79_eeOKPaIBoqte40Qq5aJwdKH4ThAj2rZS8vhpPk5kC1YeSZFyW2sInUHzpEs4XpUyhfjbI_LkhtB0V9wNAymY2UQ&disp=emb&zw\" height=\"497\" width=\"1012\" alt=\"image.png\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px; height: auto; max-width: 100%;\"><br><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><img src=\"https://mail.google.com/mail/u/0?ui=2&ik=9b61b8aad0&attid=0.1.5&permmsgid=msg-f:1844040270644157340&th=199758db23429b9c&view=fimg&fur=ip&permmsgid=msg-f:1844040270644157340&sz=s0-l75-ft&attbid=ANGjdJ_DFLXyRpE_2ssAf-if0oLx5rTXy5xvIrBPqGSzpbTgejcdM2mWGbpTTV3wft3Fgk2gsUVdk9elAQh648WiVOBrA9IDIpWrShIqJkvgz93FFW8eUwXjwxXbs_w&disp=emb&zw\" height=\"494\" width=\"1010\" alt=\"image.png\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px; height: auto; max-width: 100%;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><b><font color=\"#ff0000\">Issue: We did not receive any payment notification from PayMaya on the day the bookings were made</font></b><font color=\"#ff0000\"><b>. Since these reservations were under Non-Refundable rates, we were expecting an immediate payment capture or confirmation</b></font>. Kindly advise:</div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br>1. How the payment gateway processes funds for non-refundable website bookings.</div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">2. Whether any settings or integrations need to be checked on our PayMaya or STAAH accounts.<br>3. The recommended steps to verify if payment was successfully processed for these reservations.</div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br>Your prompt assistance will help us ensure a smooth experience for our guests and accurate payment reconciliation.<br><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">Thank you for your support.</div>', 'Optima PMS', '102501', 'Other', 'High', '0', '<div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">Hi Marvie, <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">We checked and there is no Payment Gateway connected on STAAH for Feliz hotel. For the system to reflect the payment received the sync needs to be complete between STAAH and PG. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">As for Paymaya currently we are not integrated with this PG. But, we do have an Offline Payment option in the PG Tab. You can connect with that for the payments. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">All PGs are third party so once they receive the amount they confirm the bookings on STAAH. We do not have access to the accounts. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">SETUP - <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">BOOKING ENGINE - MENU - SETTINGS - PAYMENT GATEWAY - CHOOSE OFFLINE PAYMENT - COMPLETE THE SETUP - CLICK ON SAVE<br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">We also have the option of Secure Payments - <a href=\"https://support.staah.com/portal/en/kb/articles/staah-max-what-is-secure-payments-how-is-it-useful\" rel=\"noreferrer\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://support.staah.com/portal/en/kb/articles/staah-max-what-is-secure-payments-how-is-it-useful&source=gmail&ust=1758701865393000&usg=AOvVaw3MTNLo1IgobG1Sm-Oroyxa\" style=\"color: rgb(17, 85, 204);\"><span style=\"font-weight: bolder;\"><u>https://support.staah.com/<wbr>portal/en/kb/articles/staah-<wbr>max-what-is-secure-payments-<wbr>how-is-it-useful</u></span><br></a></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">Once the above is setup, the bookings will come in with payments. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">We can get on a call to dis', '1201594 ', '<div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><p style=\"color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; font-weight: 700;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Good Day GM</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Our Action Plan for Payment Gateway Concern</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"font-weight: bolder; color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Temporary Solution:</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: small;\"><li style=\"margin-left: 15px;\">We will set up the \"Offline Payment\" option in STAAH and have confirmed with a STAAH agent that this will not affect our OTA channels.</li><li style=\"margin-left: 15px;\">For all direct bookings, we will manually contact the guest and send a Paymaya payment link.</li></ul><p style=\"color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; font-weight: 700;\"><span style=\"font-weight: bolder; color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Long-Term Solution:</span><br style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"></p><ul style=\"font-family: Arial, Helvetica, sans-serif; font-size: small;\"><li style=\"margin-left: 15px;\">We are pursuing a new payment gateway that is compatible with STAAH.</li><li style=\"margin-left: 15px;\">Based on a recommendation from the Reservations and Front Office teams, we are looking into IP88.</li><li style=\"margin-left: 15px;\">Ms Marvie already Contact IP88 and request for requirements and will coordinate to Finance for All requirements:</li><ul><li style=\"margin-left: 15px;\">List of Requirement for Ecoms Inf', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"653\" style=\"width: 489pt;\">\r\n <colgroup><col width=\"313\" style=\"mso-width-source:userset;width:235pt\">\r\n <col width=\"340\" style=\"mso-width-source:userset;width:255pt\">\r\n </colgroup><tbody><tr height=\"115\" style=\"mso-height-source:userset;height:86.28pt\">\r\n  <td height=\"115\" class=\"oa1\" width=\"313\" style=\"height:86.28pt;width:235pt\">\r\n  <p style=\"line-height: normal; margin-top: 0pt; margin-bottom: 0pt; margin-right: 0in; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; font-variant-emoji: normal; color: black; font-weight: normal;\">Actively\r\n  pursuing compatible payment solutions for the STAAH Channel Manager.</span></p>\r\n  </td>\r\n  <td class=\"oa1\" width=\"340\" style=\"width:255pt\">\r\n  <p style=\"line-height: normal; margin-top: 0pt; margin-bottom: 0pt; margin-right: 0in; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; font-variant-emoji: normal; color: black;\">Integration\r\n  Dependency:</span><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; font-variant-emoji: normal; color: black; font-weight: normal;\">\r\n  The current old gateway (PAYMAYA) is not integrated with STAAH. Currently\r\n  evaluating:</span></p>\r\n  <div style=\"line-height: normal; margin: 0pt 0in 0pt 0.31in; text-indent: -0.31in; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size:14.0pt\"><span style=\"mso-special-format:bullet;color:black;font-family:Arial\">•</span></span><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; font-variant-emoji: normal; color: black;\">IP88:</span><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; font-variant-emoji: normal; color: black; font-weight: normal;\">\r\n  Presentation complete, proposal received</span></div>\r\n  <div style=\"line-height: normal; margin: 0pt 0in 0pt 0.31in; text-indent: -0.31in; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size:14.0pt\"><span style=\"mso-special-format:bullet;color:black;font-family:Arial\">•</span></span><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; font-variant-emoji: normal; color: black;\">Pesopay</span><span style=\"font-size: 14pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; fo', '', 'In Progress', '2025-10-08 16:55:19'),
(35, '2025-24-09', '2025-24-09', 'Connection was terminated on Ms. April Joy\'s Account', 'Connection Issue', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Hi Optima Helpdesk,</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">We are getting an SQL error that says <b>\"Connection was terminated\"</b> on the account of <b>Ms. April Joy, Front Office</b>. We encountered this issue today.</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">I have attached a screenshot of the error for your reference.</p><p><img src=\"https://mail.google.com/mail/u/0?ui=2&ik=9b61b8aad0&attid=0.1&permmsgid=msg-a:r5799312919127155121&th=1997943f1bbbd4fd&view=fimg&fur=ip&permmsgid=msg-a:r5799312919127155121&sz=s0-l75-ft&attbid=ANGjdJ83gB6Cvq-YGhxNyq_Yp4GiiwqkJO6UgtjrdnScWuWr3mT-R0UKcnL6FQ4gcc-ixPwF8Zs27g0OPuuTRUFZITI1qwbJLWeHROGHsIsWdo-JrRLNYW9RrA3J7m4&disp=emb&realattid=ii_mfxacdmf0&zw\" alt=\"image.png\" width=\"503\" height=\"386\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Please assist us in resolving this issue</p>', 'Optima PMS', '102501', 'Data Error', 'High', '0', '<p>Check Cable Connection Disable Wifi in Front Office PC</p>', 'SCSB2542014 ', '<p>Check Cable Connection Disable Wifi in Front Office PC</p>', '<p>Check Cable Connection Disable Wifi in Front Office PC</p>', '', 'Done', '2025-10-08 16:55:19'),
(36, '2025-24-09', ' ', 'Clarification on Payment Gateway Process for Direct Website Bookings - Feliz Hotel Boracay', 'Payment Gateway', '<div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><div><font face=\"sans-serif\" color=\"#000000\">Dear Support Team,</font></div><div><font face=\"sans-serif\" color=\"#000000\"><br></font></div><div><font face=\"sans-serif\" color=\"#000000\">Feliz Dia!</font></div><div><font face=\"sans-serif\" color=\"#000000\"><br></font></div><div>We would like to request clarification regarding the payment flow for our direct website bookings, as we encountered the following issue:</div><div><br>Booking Source: Website (captured in STAAH under “Website Bookings”) but booking is under non-refundable.</div><div><br></div><div><img src=\"https://mail.google.com/mail/u/0?ui=2&ik=9b61b8aad0&attid=0.1.4&permmsgid=msg-f:1844040270644157340&th=199758db23429b9c&view=fimg&fur=ip&permmsgid=msg-f:1844040270644157340&sz=s0-l75-ft&attbid=ANGjdJ-I0277P0slSHUjKcEgrTfbg38qNiDHX79_eeOKPaIBoqte40Qq5aJwdKH4ThAj2rZS8vhpPk5kC1YeSZFyW2sInUHzpEs4XpUyhfjbI_LkhtB0V9wNAymY2UQ&disp=emb&zw\" height=\"497\" width=\"1012\" alt=\"image.png\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px; height: auto; max-width: 100%;\"><br><br></div><div><img src=\"https://mail.google.com/mail/u/0?ui=2&ik=9b61b8aad0&attid=0.1.5&permmsgid=msg-f:1844040270644157340&th=199758db23429b9c&view=fimg&fur=ip&permmsgid=msg-f:1844040270644157340&sz=s0-l75-ft&attbid=ANGjdJ_DFLXyRpE_2ssAf-if0oLx5rTXy5xvIrBPqGSzpbTgejcdM2mWGbpTTV3wft3Fgk2gsUVdk9elAQh648WiVOBrA9IDIpWrShIqJkvgz93FFW8eUwXjwxXbs_w&disp=emb&zw\" height=\"494\" width=\"1010\" alt=\"image.png\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px; height: auto; max-width: 100%;\"><br></div><div><br></div><div><b><font color=\"#ff0000\">Issue: We did not receive any payment notification from PayMaya on the day the bookings were made</font></b><font color=\"#ff0000\"><b>. Since these reservations were under Non-Refundable rates, we were expecting an immediate payment capture or confirmation</b></font>. Kindly advise:</div><div><br>1. How the payment gateway processes funds for non-refundable website bookings.</div><div>2. Whether any settings or integrations need to be checked on our PayMaya or STAAH accounts.<br>3. The recommended steps to verify if payment was successfully processed for these reservations.</div><div><br>Your prompt assistance will help us ensure a smooth experience for our guests and accurate payment reconciliation.<br><br></div><div>Thank you for your support.</div></div>', 'Optima PMS', '102501', 'Other', 'High', '1010126', '<div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">Hi Marvie, <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">We checked and there is no Payment Gateway connected on STAAH for Feliz hotel. For the system to reflect the payment received the sync needs to be complete between STAAH and PG. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">As for Paymaya currently we are not integrated with this PG. But, we do have an Offline Payment option in the PG Tab. You can connect with that for the payments. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">All PGs are third party so once they receive the amount they confirm the bookings on STAAH. We do not have access to the accounts. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">SETUP - <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">BOOKING ENGINE - MENU - SETTINGS - PAYMENT GATEWAY - CHOOSE OFFLINE PAYMENT - COMPLETE THE SETUP - CLICK ON SAVE<br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">We also have the option of Secure Payments - <a href=\"https://support.staah.com/portal/en/kb/articles/staah-max-what-is-secure-payments-how-is-it-useful\" rel=\"noreferrer\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://support.staah.com/portal/en/kb/articles/staah-max-what-is-secure-payments-how-is-it-useful&source=gmail&ust=1758701865393000&usg=AOvVaw3MTNLo1IgobG1Sm-Oroyxa\" style=\"color: rgb(17, 85, 204);\"><b><u>https://support.staah.com/<wbr>portal/en/kb/articles/staah-<wbr>max-what-is-secure-payments-<wbr>how-is-it-useful</u></b><br></a></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">Once the above is setup, the bookings will come in with payments. <br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: verdana; font-size: 13px; font-weight: 400;\">We can get on a call to discuss this further if needed. <', '1201594 ', '<h3>Phase 1: Planning and Research</h3><p></p><p><span style=\"font-weight: normal;\">Before you start an application, you must do your homework. Choosing the wrong gateway can lead to major headaches.</span></p><ol start=\"1\"><li><p><span style=\"font-weight: normal;\">Check for STAAH Integration: This is your top priority. You must choose a payment gateway that is on STAAH\'s list of integrated partners. This ensures that the system can automatically communicate to confirm payments. You can usually find this list on the STAAH website or by asking their support team.</span></p></li><li><p><span style=\"font-weight: normal;\">Evaluate Your Needs:</span></p><ul><li><p><span style=\"font-weight: normal;\">Guest Demographics: Do you primarily serve local guests who prefer e-wallets (like GCash or Maya) or over-the-counter payments? Or do you get more international guests who use major credit cards (Visa, Mastercard, Amex)?</span></p></li><li><p><span style=\"font-weight: normal;\">Security: Ensure the gateway is PCI DSS compliant. This is the highest security standard for handling credit card data and is non-negotiable for hotels.</span></p></li><li><p><span style=\"font-weight: normal;\">Features: Look for features like multi-currency support, automated pre-authorizations, and robust fraud detection.</span></p></li></ul></li><li><p><span style=\"font-weight: normal;\">Compare Pricing: Get quotes from a few different providers. Look at the total cost, which includes:</span></p><ul><li><p><span style=\"font-weight: normal;\">Setup Fee: A one-time fee to get started.</span></p></li><li><p><span style=\"font-weight: normal;\">Transaction Fees: A percentage and/or a fixed amount charged per transaction.</span></p></li><li><p><span style=\"font-weight: normal;\">Monthly Fees: Some providers charge a recurring monthly or annual fee.</span></p></li></ul></li></ol><p></p><h3>Phase 2: Application and Documentation</h3><p></p><p><span style=\"font-weight: normal;\">Once you\'ve chosen a payment gateway, you\'ll need to apply for a merchant account. This is a formal process where you provide legal and financial information about your business.</span></p><p><span style=\"font-weight: normal;\">Typical Requirements for a Hotel:</span></p><ul><li><p><span style=\"font-weight: normal;\">Business Registration: Your Certificate of Incorporation or Business Registration from the Securities and Exchange Commission (SEC) or Department of Trade and Industry (DTI).</span></p></li><li><p><span style=\"font-weight: normal;\">Tax Documents: Your Certificate of Registration from the Bureau of Internal Revenue (BIR) (Form 2303).</span></p></li><li><p><span style=\"font-weight: normal;\">Company Profile: A brief overview of your hotel, including your business model and target market.</span></p></li><li><p><span style=\"font-weight: normal;\">Bank Account Details: A corporate bank account where the payment gateway will deposit your funds.</span></p></li><li><p><span style=\"font-weight: normal;\">Valid IDs: A copy ', '', '', 'In Progress', '2025-10-08 16:55:19');
