(37, '2025-24-09', '', '', '', '<p><span style=\"font-weight: normal;\">Feliz Dia! @Ms Issa-Optima Miss and Support team. We would like to request your assistance in checking if it’s possible to update the agent type for one reservation that currently reflects two different agents especially to direct bookings website.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2025-09-24 at 13.13.42_c552b31e.jpg\" style=\"width: 1280px;\"><span style=\"font-weight: normal;\"><br></span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2025-09-24 at 13.13.43_387ade01.jpg\" style=\"width: 1280px;\"><span style=\"font-weight: normal;\"><br></span></p>', 'Optima PMS', '102501', '', '', '1010126', '', '', '', '', '', 'New', '2025-10-08 16:55:19');
INSERT INTO `itsystem` (`systemid`, `datereported`, `dateaccomplish`, `subject`, `module`, `description`, `systemtypes`, `projectid`, `errortypes`, `prioritylevel`, `reportedby`, `remarks`, `ticketid`, `findings`, `actiontaken`, `file`, `status`, `createdat`) VALUES
(38, '2025-29-09', ' ', 'URGENT: POS System Operation Concerns - Fix Required Before Go-Live', 'POS System', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Hi Optima Team,</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">We require your support regarding urgent operational concerns in our POS system. <b>We need these issues fixed before we can go live with the POS system.</b></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Please prioritize the issues outlined in the attached Google Sheet. All text highlighted in <b>red</b> requires immediate fix and is necessary for current F&B operations.</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><b>Google Sheet Link to All Concerns:</b> <span class=\"gmail-\"><span class=\"gmail-ng-star-inserted\"><a target=\"_blank\" rel=\"noopener\" href=\"https://docs.google.com/spreadsheets/d/1gXO3HV2J0PzkCP-pUmIBBcQjlQiCckamZ_KBgIod5O0/edit?usp=sharing\" class=\"gmail-ng-star-inserted\" style=\"color: rgb(17, 85, 204);\">https://docs.google.com/spreadsheets/d/1gXO3HV2J0PzkCP-pUmIBBcQjlQiEckamZ_KBgIod5O0/edit?usp=sharing</a></span></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">This document is our live list of required fixes for now. We will add any additional operational concerns here or send them in a separate communication as they arise.</p>', 'Optima PMS', '102509', 'Request for Assistance', '', '1010163', '<p>Done Follow October 17 2025</p>', 'SCSB2542602 ', '', '', '', 'New', '2025-10-17 05:53:43'),
(39, '2025-08-10', '2025-08-10', 'Request for Additional Transaction Code', 'Transaction Code', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Hi Itay,</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><i><br></i></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><i>Feliz Dia!</i></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Hope you are well. May we request of the following transaction to be added in the system:</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><img src=\"data:image/png;base64,\" style=\"width: 307px;\" data-filename=\"image.png\"><br></div>', 'Optima PMS', '102501', 'Request for Assistance', 'Medium', '1010152', '', '', '', '', '', 'Done', '2025-10-10 04:44:46');
