(40, '2025-08-10', ' ', 'Additional Outlet Request for POS', 'Additional Outlet Request for POS', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Dear Optima Helpdesk,</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">We are requesting an additional outlet for the POS Outlet: \"Room Service\".​</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><img src=\"data:image/png;base64,\" style=\"width: 773px;\" data-filename=\"image.png\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Thank you,</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Armani</div>', 'Optima PMS', '102509', 'Request for Assistance', 'High', '1010174', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><b>Dear Optima Helpdesk,</b></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">We need to finalize the list of Point-of-Sale (POS) outlets in our system.</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Please ensure the following four outlets are active. The addition of <b>Room Service</b> and <b>Banquet</b> is our primary request:</p><ul style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><li><p><b>La Plaza</b></p></li><li><p><b>Buenavista</b></p></li><li><p><b>Room Service</b></p></li><li><p><b>Banquet</b></p></li></ul><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">These outlets are necessary to separate and identify revenue correctly</p>', 'SCSB2543610 | SCSB2544088 ', '', '', '', 'In Progress', '2025-10-10 05:14:15');
