(41, '2025-10-10', '2025-13-10', 'Update SC Tax Code for MINIB Category', 'Transaction Code', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><p><b>Hi Optima Team,</b></p><p>We are requesting an update to the Tax code: update <b>Service Charge (SC) 5%</b> tagging to <b>SCFNB 10%</b> configuration for the <b>MINIB</b> category on the attached list.</p></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 351px;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">​<br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><div dir=\"ltr\" class=\"gmail_signature\" data-smartmail=\"gmail_signature\"><div dir=\"ltr\"><div dir=\"ltr\"><p style=\"color: rgb(0, 0, 0); font-size: 11px; line-height: 13.2px; letter-spacing: 0.02em; font-family: sans-serif;\">Warmest Regards,</p></div></div></div></div>', 'Optima PMS', '102501', 'Request for Assistance', 'Medium', '1010152', '<p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></p>', 'SCSB2544087 ', '<p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font color=\"#0000ff\">Consider it done.</font></p><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(0, 0, 255);\">Please confirm to me that all works as intended now. </span></p><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><span style=\"color: rgb(0, 0, 255);\">Itay franco</span></p>', '', '', 'Done', '2025-10-13 04:18:27'),
(42, '2025-10-10', ' ', 'URGENT and Important follow-up on OPTIMA CONCERNS', 'PMS', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><strong><font face=\"arial, sans-serif\">Dear Sir Armani,</font></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\"><strong>Feliz día!</strong> I hope this message finds you well.</font></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\">Following up on our recent discussion, I would like to formally reiterate the concerns we have encountered regarding the reports generated from the Optima system.<br>We have updated the tracking spreadsheet to document each issue, including specific observations and examples for your reference. You can access the file via this link:<font color=\"#660000\"> </font><font color=\"#0b5394\"><b><a href=\"https://docs.google.com/spreadsheets/d/19Cw3rFfVTekXYvO49o0NbGGj26XU7Vc34xd-l6umqN8/edit?usp=sharing\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://docs.google.com/spreadsheets/d/19Cw3rFfVTekXYvO49o0NbGGj26XU7Vc34xd-l6umqN8/edit?usp%3Dsharing&source=gmail&ust=1760147215333000&usg=AOvVaw2A0MAfSrtK9TzglaqsncHj\" style=\"color: rgb(17, 85, 204);\">https://docs.google.com/<wbr>spreadsheets/d/<wbr>19Cw3rFfVTekXYvO49o0NbGGj26XU7<wbr>Vc34xd-l6umqN8/edit?usp=<wbr>sharing</a></b></font></font></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\">As of today, the generated reports from Optima <b>still do not align </b>with the expected proforma. Specifically:</font></p><ul style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><li style=\"margin-left: 15px;\"><p><font face=\"arial, sans-serif\"><strong>Income Audit Reports</strong>: There is an excessive amount of unnecessary information included, which affects the clarity of the report.</font></p></li><li style=\"margin-left: 15px;\"><p><font face=\"arial, sans-serif\"><strong>Gencash and AR Reports</strong>: Several key data entries are either missing or not properly reflected, making it difficult to reconcile figures accurately.</font></p></li></ul><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\">To assist in your review, I have attached a visual comparison (snip) in the sheet, showing the differences between our current/expected format and the one currently being generated in Optima.<br></font></p><p><font face=\"arial, sans-serif\" style=\"color: rgb(34, 34, 34); font-size: small; font-weight: 400;\"><img src=\"https://mail.google.com/mail/u/0?ui=2&ik=9b61b8aad0&attid=0.1&permmsgid=msg-f:1845509226643444351&th=199c90dd1bc9d27f&view=fimg&fur=ip&permmsgid=msg-f:1845509226643444351&sz=s0-l75-ft&attbid=ANGjdJ-VLROIFhW88NhAo-AqijZ6YYoOLRUilpCmXcEqkgyCPueka7lZ-eEl8nVVLRZLgNvgDiKN2QNpwKPxlvgmPi-GZ27dsDDHmaMBD_1b-wgPOIUvAx_l89DoCW4&disp=emb&realattid=ii_mgjf32el1&zw\" alt=\"image.png\" width=\"940\" height=\"447\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px;\"></font></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\"><br></font></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\">Additionally, I have already forwarded the email thread concerning the <strong>POS computation</strong>, which includes all relevant files and references.<br>We are particularly hoping to receive an update on the <strong>status of the generated POS invoices</strong> in Optima versus the version we expected.   </font></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\">We understand these adjustments may take some time, but we’re hoping to align the reports as soon as possible to ensure smoother operations and accurate reporting on our end.</font></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\">Please don’t hesitate to reach out if further details are needed from our side, or if there are developments on the concerns outlined above.</font></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><font face=\"arial, sans-serif\">Looking forward to your feedback.<br>Wishing you a productive and pleasant day ahead!</font></p>', 'Optima PMS', '102501', 'Request for Modification', 'High', '1010155', '', 'SCSB2544086 ', '', '', '', 'In Progress', '2025-10-10 04:44:46'),
