(47, '2025-11-10', '', 'Assistance Required-Duplicate Reservation from STAAH (Booking.com', 'Assistance Required-Duplicate Reservation from STAAH (Booking.com', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Dear Sir Armani,</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Feliz Dia!</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">We would like to ask for your assistance to verify a possible duplicate reservation received from STAAH under Booking.com. Please see the reservation details below for your reference.</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><img src=\"https://mail.google.com/mail/u/0?ui=2&amp;ik=9b61b8aad0&amp;attid=0.1&amp;permmsgid=msg-f:1845676840802354632&amp;th=199d294ed23085c8&amp;view=fimg&amp;fur=ip&amp;permmsgid=msg-f:1845676840802354632&amp;sz=s0-l75-ft&amp;attbid=ANGjdJ_rE9jFU3_bEDowagQPq8moIIlK59ITJcO7dZ0K0ALSyW8Uf81o4AJqLbEKWr3Q-RdeSAlAqEMbAQl-ntxw5VZcn2A3xIQqEfTDzmQd1h3ThYJCN0mdoLqQDFw&amp;disp=emb&amp;realattid=ii_mgm2dpfd0&amp;zw\" alt=\"image.png\" width=\"1242\" height=\"499\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px;\"><br><br><img src=\"https://mail.google.com/mail/u/0?ui=2&amp;ik=9b61b8aad0&amp;attid=0.2&amp;permmsgid=msg-f:1845676840802354632&amp;th=199d294ed23085c8&amp;view=fimg&amp;fur=ip&amp;permmsgid=msg-f:1845676840802354632&amp;sz=s0-l75-ft&amp;attbid=ANGjdJ-0M8Nobrf5wsRx_25nu5wXGaGa02fR58FpfQM2SUISf65UF-HuHwc5REF26fXY7pxCX-ip5d7QD20RBwBJEZnM_EERY6mLndBFRP2w4iH14wxMoGoO177Jlo8&amp;disp=emb&amp;realattid=ii_mgm2e9t41&amp;zw\" alt=\"image.png\" width=\"1251\" height=\"549\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px;\"><br>Upon checking, we also received modification updates for the same booking. Kindly review the information below and advise us on the correct action to take.<br><br><img src=\"https://mail.google.com/mail/u/0?ui=2&amp;ik=9b61b8aad0&amp;attid=0.3&amp;permmsgid=msg-f:1845676840802354632&amp;th=199d294ed23085c8&amp;view=fimg&amp;fur=ip&amp;permmsgid=msg-f:1845676840802354632&amp;sz=s0-l75-ft&amp;attbid=ANGjdJ-xDxBHjvwOO4SYISHSQGY38KWo-NUy3t_3G6SOHKPze6suUIR-Ddu4STPckCyiCLbA20x8zWcQgs-hErwOa0FXztUfqRfgnwUjv6OKwFpJWm1c3muzKQBh0Io&amp;disp=emb&amp;realattid=ii_mgm2gi1k3&amp;zw\" alt=\"image.png\" width=\"1279\" height=\"254\" data-image-whitelisted=\"\" class=\"CToWUd a6T\" data-bit=\"iit\" tabindex=\"0\" style=\"cursor: pointer; outline: 0px; margin-right: 0px;\"><br><br>We appreciate your prompt assistance on this matter to avoid any discrepancy in our system.<br><br>Thank you and we look forward to your guidance.</div>', 'STAAH', '102507', '', '', '1010163', '', '', '', '', '', 'New', '2025-10-11 10:01:41');
