(49, '2025-17-10', '', 'URGENT: Formatting Issues on Registration Card and Confirmation Letter', 'URGENT: Formatting Issues on Registration Card and Confirmation Letter', '<p>Here is the shortened, direct version of the email request:</p><hr><p>Subject: URGENT: Formatting Issues on Registration Card and Confirmation Letter</p><p>Dear Optima Help Desk,</p><p>We need your urgent assistance with the <b>Registration Card and Confirmation Letter</b> formats in our PMS system.</p><p>The current printouts are <b>not presentable to guests</b> due to missing text and words.</p><p>Please see the attached image for reference and assist in correcting these formats immediately.</p><p>Thank you</p>', 'Optima PMS', '102501', '', '', '1010163', '', '', '', '', '', 'New', '2025-10-17 06:22:14');
