(50, '2025-27-10', ' ', 'Concern: STAAH Cancellations Not Captured by Optima', 'STAAH to Optima PMS', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Dear Sir Armani,</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">Feliz Dia!</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">We would like to raise a concern regarding a cancellation in STAAH that was not captured by Optima today. Please see the details below for your reference:</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><img src=\"data:image/png;base64,\" style=\"width: 1488.96px;\" data-filename=\"image.png\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><img src=\"data:image/png;base64,\" style=\"width: 1786.25px;\" data-filename=\"image.png\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-weight: 400;\">We would appreciate your assistance in checking and syncing the update in the system to avoid discrepancies in our inventory and availability.<br><br>Thank you for your prompt attention to this matter. Please let us know once the issue has been resolved or if you need further information from our end</div>', 'STAAH', '102501', 'Request for Assistance', 'High', '1010163', '', '1218357', '', '', '', 'In Progress', '2025-10-27 08:07:29');
