INSERT INTO `mktgdisplay` (`id`, `title`, `description`, `discategoryid`, `categoryid`, `startdate`, `enddate`, `checkofficephoto`, `slidecategory`, `created_at`) VALUES
(1, 'Emergency Evacuation Drill', 'Attention Guests: An emergency evacuation drill will be conducted today, July 1, 2025, at 10:00 AM. Please follow staff instructions.', '1', '1', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(2, 'Typhoon Warning Issued', 'Urgent: A Typhoon Warning has been issued for the area. Please remain indoors and follow all safety advisories from resort staff.', '1', '1', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(3, 'Pool Closure - Emergency', 'The Main Pool is temporarily closed for emergency maintenance until further notice. We apologize for any inconvenience.', '1', '1', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(4, 'Power Interruption Advisory', 'Anticipated power interruption from 11:00 PM - 2:00 AM for essential electrical repairs. Generators will be active for critical services.', '1', '1', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(5, 'Beach Advisory - Strong Currents', 'Caution: Strong currents detected. Swimming is permitted only within designated areas. Lifeguards are on duty.', '1', '2', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(6, 'Restaurant Reservations Recommended', 'To ensure your preferred dining time, we highly recommend making reservations for our beachfront restaurant, \'The Coral Bistro\'.', '1', '2', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(7, 'Check-Out Reminder', 'A friendly reminder: Standard check-out time is 12:00 PM. Please contact the front desk for late check-out requests.', '1', '2', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(8, 'Valuables Safety Notice', 'Guests are advised to secure all valuables in their in-room safety deposit boxes. The resort is not responsible for items left unattended.', '1', '2', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(9, 'New Kids\' Club Hours', 'Our Kids\' Club now operates daily from 9:00 AM to 5:00 PM, offering exciting new activities for our younger guests.', '1', '5', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(10, 'Expanded Spa Menu', 'Discover our expanded spa menu featuring new signature massages and wellness treatments. Book your rejuvenating experience today!', '1', '5', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(11, 'Guest Feedback Survey', 'Help us enhance your stay! Please complete our quick guest feedback survey available via the QR code at the front desk', '1', '5', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(12, 'Water Sports Center Open', 'The Water Sports Center is now fully open! Enjoy kayaking, paddleboarding, and snorkeling gear rentals from 8:00 AM - 4:00 PM.', '1', '5', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(13, 'Eco-Friendly Initiative', 'Tip: Help us protect our beautiful environment! Reuse your towels to reduce water and energy consumption.', '1', '3', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(14, 'Best Sunset Viewing Spot', 'Our tip for a breathtaking view: Head to the Lighthouse Point at 6:30 PM for the most spectacular sunset photos!', '1', '3', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(15, 'Hydration Reminder', 'Staying hydrated is key in the sun! Remember to drink plenty of water throughout the day. Complimentary water stations are available.', '1', '3', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(16, 'Booking Excursions Made Easy', 'Tip: Plan your adventures hassle-free! Visit our Tour Desk in the lobby to book exciting excursions and activities.', '1', '3', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(17, 'Beach Bonfire & S\'mores', 'Join us for a cozy Beach Bonfire tonight, July 1, 2025, at 7:00 PM by the main beach. S\'mores kits provided!', '1', '4', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
(18, 'Morning Yoga Session', 'Start your day with tranquility! Complimentary Morning Yoga at the Ocean Deck, daily at 7:00 AM. Mats provided.', '1', '4', '2026-01-01', '2026-01-31', '', '3', '2026-01-02 03:11:13'),
